import React, { useEffect, useState } from 'react';
import { adminAPI } from '../services/api';

const AdminReportsPage = () => {
  const [reports, setReports] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchReports = async () => {
      try {
        const response = await adminAPI.getReports();
        setReports(response.data.data || {});
      } catch (err) {
        setError('Failed to load reports');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };
    fetchReports();
  }, []);

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary-600"></div>
      </div>
    );
  }

  if (error) {
    return <div className="text-red-600">{error}</div>;
  }

  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-3xl font-bold text-gray-900">Reports</h1>
        <p className="text-gray-600">Attendance analytics and summaries.</p>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <div className="card p-6">
          <p className="text-sm text-gray-600">Total Attendance Records</p>
          <p className="text-2xl font-bold text-gray-900">{reports.total_attendance_records ?? '-'}</p>
        </div>
        <div className="card p-6">
          <p className="text-sm text-gray-600">Average Attendance Rate</p>
          <p className="text-2xl font-bold text-gray-900">{reports.average_attendance_rate != null ? `${(reports.average_attendance_rate * 100).toFixed(1)}%` : '-'}</p>
        </div>
        <div className="card p-6">
          <p className="text-sm text-gray-600">Active Classes</p>
          <p className="text-2xl font-bold text-gray-900">{reports.active_classes ?? '-'}</p>
        </div>
      </div>

      {Array.isArray(reports.topStudents) && reports.topStudents.length > 0 && (
        <div className="card p-6">
          <h2 className="text-xl font-semibold text-gray-900 mb-4">Top Students</h2>
          <div className="overflow-x-auto">
            <table className="min-w-full divide-y divide-gray-200">
              <thead className="bg-gray-50">
                <tr>
                  <th className="table-header">Student</th>
                  <th className="table-header">Attendance Rate</th>
                </tr>
              </thead>
              <tbody className="bg-white divide-y divide-gray-200">
                {reports.topStudents.map((s, idx) => (
                  <tr key={idx}>
                    <td className="table-cell font-medium">{s.student_name || s.name}</td>
                    <td className="table-cell">{s.attendance_rate != null ? `${(s.attendance_rate * 100).toFixed(1)}%` : '-'}</td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
        </div>
      )}
    </div>
  );
};

export default AdminReportsPage;
